import React from 'react';
import './DeliveryOptions.css'; // Импорт стилей для опций доставки

const DeliveryOptions = () => {
  return (
    <div className="delivery-options">
      <h3>Варианты доставки</h3>
      <ul>
        <li>Стандартная доставка (3-5 дней)</li>
        <li>Экспресс-доставка (1-2 дня)</li>
      </ul>
    </div>
  );
};

export default DeliveryOptions;
